/************************************************
 * Parse Google Maps directions response
 ***********************************************/

function getBoundingBox(response) {
    const sw = response.routes[0].bounds.southwest;
    const ne = response.routes[0].bounds.northeast;
    return [[sw.lng, sw.lat], [ne.lng, ne.lat]];
}

function getWaypointsGeoJSON(response) {
    const waypoints = {
        "type": "FeatureCollection",
        "features": []
    };
    for (const leg of response.routes[0].legs) {
        waypoints.features.push({
            "type": "Feature",
            "geometry": {
                "type": "Point",
                "coordinates": [
                    leg.start_location.lng,
                    leg.start_location.lat
                ]
            },
            // TODO: change image
            "properties": {
                "address": leg.start_address,
                "distance_to_next": leg.distance.text,
                "image_url": "https://www.nps.gov/lamr/planyourvisit/images/lake-Meredith-Fritch-fortress.jpg?maxwidth=650&autorotate=false"
            }
        });
    }
    return waypoints;
};

// TODO: Change hard-coded pickuptime and dropofftime times
function getRouteGeoJSON(response) {
    const route = {
        "type": "Feature",
        "geometry": {
            "type": "LineString",
            "coordinates": []
        }
    }
    const decoded = polyline.decode(
        response.routes[0].overview_polyline.points
    );
    for (const coord of decoded) {
        route.geometry.coordinates.push(coord.reverse());
    }
    return route;
}

// This method generates the detailed route coordinates
// However, this can cause the map to load very slowly
function getDetailedRouteGeoJSON(response) {
    const route = {
        "type": "Feature",
        "geometry": {
            "type": "LineString",
            "coordinates": []
        }
    }

    const legs = response.routes[0].legs;
    for (const leg of legs) {
        const steps = leg.steps;
        for (const step of steps) {
            const points = step.polyline.points;
            const decoded = polyline.decode(points);
            for (var i = 0; i < decoded.length; i++) {
                if ((i + SAMPLE_RATE) % SAMPLE_RATE === 0) {
                    route.geometry.coordinates.push(decoded[i].reverse());
                }
            }
        }
    }
    return route;
}


